import React from 'react';
import Col from "react-bootstrap/Col"
import Row from "react-bootstrap/Row"
import TypeBar from "../components/TypeBar"
import {Container} from "react-bootstrap"


const Shop = () => {
    return (
        <Container>
            <Row className="mt-2">
                <Col md={3}>
                    <TypeBar/>
                </Col>
                <Col md={9}>
                    <BrandBar/>
                </Col>
            </Row>
        </Container>
    );
};

export default Shop;
